/*
--!!!
select UnitId, max (isnull(_pgPartner.PartnerId_pg,0)) as PartnerId_pg from dba._pgPartner where UnitId <>0 and PartnerId_pg <> 0 group by UnitId

--!!!
select goodsProperty_detail.Id, GoodsProperty.Id_Postgres , KindPackage.Id_Postgres
from goodsProperty_detail
     left outer join dba.GoodsProperty on GoodsProperty.Id = goodsProperty_detail.GoodsPropertyId
     left outer join dba.Goods on Goods.Id = GoodsProperty.GoodsId
     left outer join dba.KindPackage on KindPackage.Id = goodsProperty_detail.KindPackageId
                                    and Goods.ParentId not in(686,1670,2387,2849,5874) -- “‡‡ + —€– + ’À≈¡ + —-œ≈–≈–¿¡Œ“ ¿ + “”ÿ≈Õ ¿

--!!!
select _LoadToSybase.Id_old, coalesce (Object_GoodsByGoodsKind_View.Id, _LoadToSybase.GoodsId)
from _LoadToSybase
     left join Object_GoodsByGoodsKind_View on Object_GoodsByGoodsKind_View.GoodsKindId = _LoadToSybase.GoodsKindId
                                           and Object_GoodsByGoodsKind_View.GoodsId = _LoadToSybase.GoodsId

*/

